import { Component, Input } from '@angular/core';
import { Actor } from '../Actor/alta/alta.component';

@Component({
  selector: 'app-detalle-actor',
  templateUrl: './detalle-actor.component.html',
  styleUrls: ['./detalle-actor.component.css']
})
export class DetalleActorComponent {
  @Input() mostrar: boolean = false; 
  @Input() actor: Actor = new Actor; 
}
<div *ngIf="mostrar">
    <ul>
        <li>Nombre: {{actor.nombre}}</li>
        <li>Apellido: {{actor.apellido}}</li>
        <li>Direccion: {{actor.direccion}}</li>
        <li>Email: {{actor.email}}</li>
        <li>Usuario: {{actor.usuario}}</li>
        <li>zip: {{actor.zip}}</li>
    </ul>
</div>
